КонсультантПлюс: основные документы

«КонсультантПлюс: основные документы» - некоммерческий проект компании «КонсультантПлюс».

В приложении в любое время доступна наиболее востребованная правовая информация: Конституция РФ, кодексы РФ, основные правовые акты федерального законодательства, обзоры новых документов и справочные материалы.

Кроме этого в выходные и праздничные дни, а также в вечернее время по будням для пользователей сняты ограничения на доступ к расширенной базе документов, а это:

• федеральное законодательство РФ;
• законодательство Москвы и Санкт-Петербурга;
• судебная практика;
• финансовые консультации;
• законопроекты, международные правовые акты и другие документы.

Для работы без доступа в интернет можно заранее поставить закладки на любой документ или его часть, так что нужный кодекс или закон всегда будут под рукой. Документы с закладками сохраняются в разделе «Избранное».

Приложение содержит полезные сведения по многим вопросам:

• защита прав потребителей;
• как заплатить налог, налоговые льготы и вычеты;
• защита трудовых прав, трудовой договор;
• право собственности, оформление и защита имущественных прав;
• штрафы за административные правонарушения, в том числе штрафы за нарушение ПДД;
• право на получение материнского капитала и др.

Профессиональный бухгалтер, юрист или кадровик, а также руководители найдут в приложении необходимую справочную информацию (календарь бухгалтера, производственный календарь, правовой календарь, ставки налогов, курсы валют). Вся информация ежедневно обновляется. Изменения сохраненных на устройство документов загружаются автоматически.

Информацию легко найти с помощью Быстрого поиска. Достаточно указать название документа, например: «конституция РФ», «44 ФЗ», «закон о полиции», «бюджетный», «семейный», «гражданский» или «земельный кодекс». Поиск понимает разговорные слова и общепринятые сокращения (коап, гпк, гк рф 2022, ук, нк, упк, ндс, ук рф 2021). Например, можно набрать «тк» вместо «трудовой кодекс» или «ндфл» вместо «налог на доходы физических лиц». Кратко опишите ситуацию, как в интернет-поисковике, и начните изучать её (например, «обязательный аудит малых предприятий»). Использовать сокращения можно и при поиске конкретной части документа, например, «ст 158 ук рф» или «ст 77 тк рф».

Расширенный поиск поможет найти документы по известным реквизитам (дата принятия НПА, принявший орган, вид документа: закон, проект, постановление и пр.). Доступны тексты в любой редакции, даже c изменениями, не вступившими в силу. При помощи кнопки i на полях можно получить разъяснения (дополнительные документы) к абзацу или статье документа.

Ориентироваться в больших документах (таких как гражданский, налоговый или уголовный кодексы) поможет оглавление и поиск по тексту документа. Из справки к документу можно уточнить особенности и порядок его применения, период действия текущей редакции.

